import React, { useState, useEffect } from 'react'
import '../styles/instagram.css';


const InstagramHooks = () => {


        instaFields = 'id,media_type,media_url,thumbnail_url';
        imgAmount = 3;
        instaID = '17841424890644350';
        accessToken =
           'EAAlCgw1dfFIBACMKJXJBomLTOOxZBf0JbJzbJZA05vZAHNbgy2bZB44ElcpYez6CW887FPZCZBSPusQWIBPZBUmMtMIQVE4YIZATvdZCwQy9aOTZA7wwWRJt4idsiCAJtwBCSpBe5h9EPqfSjRwXvkirsZC4jX4BMCLJRs0YZAlZCXGLvMI7W4d9gYIVx';
        instaEndpoint = `https://graph.facebook.com/${this.instaID}/media?fields=${this.instaFields}&limit=${this.imgAmount}&access_token=${this.accessToken}`;
        const  [imageUrls,setimageUrls ]= useState({})


    useEffect(() => {
        async function getInstaFeed() {
            fetch(instaEndpoint)
                .then(res => res.json())
                .then(data =>  this.setState({ imageUrls: data.data.map(item => item.media_url)}))
                .catch(err => {
                    console.error(err);
                });
            }

        getInstaFeed()
    }

    )






        return (
            <div className="instagramContainer">
            {imageUrls.map(i => {
                    return (
                        <div className="imageContainer" key={i}>
                            <img src={i}></img>
                        </div>
                    );
                }
            )}
        </div>
        )


}
